⭐ CASI 1 MILLÓN DE VISUALIZACIONES EN MENOS DE 10 HORAS ⭐

🎤 Luego de dos álbumes abocados al reggaetón y su consagración absoluta en los grandes estadios con cuatro funciones agotadas en el estadio de Vélez, el cantante regresa a las grabaciones para un 2023 que lo tendrá como gran protagonista con este nuevo single: ""Si me sobrara el tiempo".

